contracts/contratoNotaMinima.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

struct Parceiron1 {
    address parceiro1;
    string nome;
    bool terminar;
}
struct Parceiron2 {
    address parceiro2;
    string nome;
    bool aceitar;
}

contract ContratoNamoroMetaVerso {
    Parceiron2 public Parceiro2;
    Parceiron1 public Parceiro1;
    uint256 datapedido;
    string public objectContrato;
    uint256 public idadedosolicitante;

    constructor(
        address _parceiro2,
        string memory _nome,
        string memory _objeto,
        uint256 _minhaidade,
        string memory _meunome
    ) {
        require(_minhaidade >= 18, "Somente maior de idade pode solicitar");
        idadedosolicitante = _minhaidade;
        Parceiro1.nome = _meunome;
        Parceiro2.parceiro2 = _parceiro2;
        Parceiro2.nome = _nome;
        datapedido = block.timestamp;
        objectContrato = _objeto;
        Parceiro1.parceiro1 = msg.sender;
    }

    function tempouniaocomprovada() public view returns (uint) {
        return block.timestamp;
    }

    function Aceitar() public {
        require(
            msg.sender == Parceiro2.parceiro2,
            "Voce nao foi pedido em namoro"
        );
        Parceiro2.aceitar = true;
    }

    function terminarnamoro() public {
        require(
            msg.sender == Parceiro2.parceiro2 ||
                msg.sender == Parceiro1.parceiro1, "Vove nao pode terminar algo quem nem comecou");
        Parceiro2.aceitar = false;
        Parceiro1.terminar = false;
    }

    function Quemtapedindo() public view returns (string memory, address) {
        return (Parceiro1.nome, Parceiro1.parceiro1);
    }
}

